import React from "react";
// import { Link } from "react-router-dom";
import socialMediaData from "../../data/socialMediaData";
import { CardGroup, Card, Container, Row, Col } from "react-bootstrap";

function SocialMediaCards() {
  return (
    <div>
      <CardGroup>
        <Container>
            {socialMediaData.map((service, key) => (
              <a href={service.link} key={key}>
                  <Card
                    style={{ width: "18rem" }}
                    className="social-media-cards"
                  >
                    <Card.Body>
                      <i className={service.icon}></i>

                      <Card.Title className="mt-3">{service.name}</Card.Title>
                      <Card.Text>{service.text}</Card.Text>
                    </Card.Body>
                  </Card>
              </a>
            ))}
        </Container>
      </CardGroup>
    </div>
  );
}

export default SocialMediaCards;
